import React from 'react'

const Total = () => {
  const parts = [
    {
      name: 'Fundamentals of React ',
      exercises: 10
    },
    {
      name: 'Using props to pass data ',
      exercises: 7
    },
    {
      name: 'State of a component ',
      exercises: 14
    }
  ]
  return (
    <div>
      <p>Number of exercises {parts[0]["exercises"] + parts[1]["exercises"] + parts[2]["exercises"]}</p>
    </div>
  )
}

const App = () => {
  const Course = () => {
    return(
      <div>
        <h1>{Header}</h1>
        <ul>
          {course.parts.map(part =>
            <li key={part.id}>
              {part.content}
            </li>
            )}
        </ul>
      </div>
    )
  }
    const Header = () => {

      return (
        <div>
          <h1>{course.id}</h1>
        </div>
      )
    }
    const Content = () => {
      const parts = [
        {
          name: 'Fundamentals of React ',
          exercises: 10
        },
        {
          name: 'Using props to pass data ',
          exercises: 7
        },
        {
          name: 'State of a component ',
          exercises: 14
        }
      ]

      return (
        <div>
          <p>{parts.name}{parts.exercises}</p>
          <p>{parts.name}{parts.exercises}</p>
          <p>{parts.name}{parts.exercises}</p>
        </div>
      )
    }




  const course = {
    id: 1,
    name: 'Half Stack application development',
    parts: [
      {
        name: 'Fundamentals of React',
        exercises: 10,
        id: 1
      },
      {
        name: 'Using props to pass data',
        exercises: 7,
        id: 2
      },
      {
        name: 'State of a component',
        exercises: 14,
        id: 3
      }
    ]
  }

  return <Course course={course} />

}

export default App
